import "./Home.css";
import Header from "../../components/header/Header";
import React, { useEffect } from "react";
import { Base } from "../../components/Base";
import CSSProps from "../../data/constants/CSSProps";
import Paths from "../../data/constants/Paths";

const Home = () => {
  useEffect(() => {
    Base.prototype.SwitchPage(CSSProps.ID.Home);
  });
  return (
    <div>
      <Header className="Header" />
      <div className="columns">
        <div className="column main-column">
          <article className="article">
            <a className="article first-article" href={Paths.None}>
              <figure className="article-figure">
                <img className="article-image" src="https://images.ctfassets.net/hrltx12pl8hq/7yQR5uJhwEkRfjwMFJ7bUK/dc52a0913e8ff8b5c276177890eb0129/offset_comp_772626-opt.jpg?fit=fill&w=800&h=300" alt={Paths.None} />
              </figure>
              <div className="article-body">
                <h2 className="article-title">Title</h2>
                <p className="article-content">Content</p>
                <footer className="article-info">Info</footer>
              </div>
            </a>
          </article>
          <article className="article">Hello World</article>
          <article className="article">Hello Konjo</article>
        </div>

        <div className="column">
          <article className="article">Hello World</article>
          <article className="article">Foo Bar</article>
          <article className="article">Hello World</article>
        </div>
      </div>
    </div>
  );
};

export default Home;
